import style from "./AuthInfo.module.scss";

const AuthInfo = () => {
  return (
    <div className={style.authContainer}>
      <div className={style.authButtons}>
        <div className={style.logIn}></div>
        <div className={style.signUp}></div>
      </div>
    </div>
  );
};

export { AuthInfo };
